    false,nt"url": null,nt"notes": "The Bureau of Sport Fisheries and Wildlife
    contracted us to do a wildlife resource inventory of the Marsh Fork in summer, 1973.
    We had planned the inventory in two phases; aerial tracking and ground work. Due
    to delays in processing the contract, we could not begin until 4 June, and we did
    not do any aerial tracking. Discussed are geology, Dall sheep, grizzly bear, moose,
    vegetation, birds, fox, fish, and plants. Contract no. 14-16-0008-743",nt"owner_org":
